INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 44, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 16, 155, 8, "東山奈央", "人助けが大好き！　前向き格闘娘", "獣人族", "A", 27, "トゥインクルウィッシュ", "人助け、応援", 100101, 2, "ヒヨリ");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 47, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 17, 158, 4, "種田梨沙", "戦闘のサポートが得意な、心優しい少女", "ヒューマン", "O", 5, "トゥインクルウィッシュ", "料理、人間観察", 100201, 2, "ユイ");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 46, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 18, 163, 1, "早見沙織", "クールで何事にも真っ直ぐな剣士", "魔族", "B", 12, "トゥインクルウィッシュ", "読書、乗馬、お茶", 100301, 2, "レイ");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 27, "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", 9, 128, 8, "諸星すみれ", "探検好きのイタズラっ子", "ヒューマン", "O", 10, "リトルリリカル", "いたずら、探検", 100401, 5, "ミソギ");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 40, "？？？", 12, 146, 11, "下田麻美", "ヒーローに憧れる騎士見習いの少女", "獣人族", "O", 25, "王宮騎士団（NIGHTMARE）", "ヒーローごっこ", 100501, 8, "マツリ");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 42, "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", 13, 150, 11, "浅倉杏美", "甘え上手なみんなの人気者", "魔族", "O", 22, "悪魔偽王国軍（ディアボロス）", "サックス", 100601, 7, "アカリ");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 32, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 14, 130, 1, "雨宮天", "プリン大好きゴースト娘", "魔族", "B", 23, "悪魔偽王国軍（ディアボロス）", "プリンを食べること", 100701, 7, "ミヤコ");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 40, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", 14, 150, 10, "大空直美", "ボクは誰よりも美しい", "エルフ", "AB", 10, "ヴァイスフリューゲル　ランドソル支部", "鏡で自分を見ること", 100801, 15, "ユキ");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 45, "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", 17, 159, 7, "髙野麻美", "前世を信じる中二病患者、「疾風の冥姫」", "魔族", "A", 5, "トワイライトキャラバン", "小説執筆", 100901, 13, "アンナ");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 42, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", 16, 155, 9, "内田真礼", "マホマホ王国のプリンセス", "獣人族", "O", 22, "自警団（カォン）", "空想、ぬいぐるみ集め", 101001, 10, "マホ");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 44, "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", 15, 156, 8, "阿澄佳奈", "人懐っこくてマシンガントークな妹系少女", "ヒューマン", "A", 25, "ラビリンス", "お裁縫", 101101, 3, "リノ");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 46, "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", 17, 156, 12, "大橋彩香", "みんなのために超能力を使う眠り姫", "エルフ", "A", 24, "フォレスティエ", "妹と遊ぶこと、二度寝、昼寝、早寝", 101201, 6, "ハツネ");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 55, "", 18, 166, 8, "佳村はるか", "オタク全開な魔法少女", "魔族", "O", 21, "トワイライトキャラバン", "読書、魔法", 101301, 13, "ナナカ");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 41, "test", 15, 152, 11, "水瀬いのり", "頭脳明晰な美少女名探偵", "獣人族", "AB", 3, "自警団（カォン）", "読書、推理", 101401, 10, "カスミ");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 54, "test", 21, 165, 9, "國府田マリ子", "母性溢れる優しいみんなの「ミサト先生」", "エルフ", "O", 5, "フォレスティエ", "絵本作り", 101501, 6, "ミサト");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 48, "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", 18, 167, 4, "上坂すみれ", "天真爛漫で人気者のカリスマモデル", "魔族", "O", 10, "ルーセント学院", "ファッション", 101601, 14, "スズナ");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 53, "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", 19, 158, 7, "高森奈津美", "いつでも「なんくるないさ～」な天然娘", "獣人族", "A", 7, "自警団（カォン）", "踊り、空手", 101701, 10, "カオリ");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 52, "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", 23, 162, 8, "伊藤静", "多くの男性を魅了する無垢な女教師", "魔族", "B", 14, "ルーセント学院", "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", 101801, 14, "イオ");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 21, "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", 10, 117, 4, "日高里菜", "お歌もにんじんも、ウサギさんも大好き♪", "獣人族", "O", 3, "リトルリリカル", "かわいいもの集め", 102001, 5, "ミミ");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 40, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 12, 150, 6, "植田佳奈", "泣き虫で臆病な守ってあげたい女の子", "ヒューマン", "B", 9, "サレンディア救護院", "観劇、おままごと", 102101, 9, "クルミ");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 40, "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", 13, 150, 11, "原紗友里", "人見知りであまのじゃくな女の子", "魔族", "O", 22, "悪魔偽王国軍（ディアボロス）", "ゲーム全般", 102201, 7, "ヨリ");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 38, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 14, 148, 5, "芹澤優", "ぷうきちといつも一緒！", "ヒューマン", "B", 10, "サレンディア救護院", "屋内でできる遊び", 102301, 9, "アヤネ");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 43, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", 15, 154, 12, "悠木碧", "お嬢さまのためにがんばるドジっ娘メイド", "ヒューマン", "O", 12, "サレンディア救護院", "ご奉仕", 102501, 9, "スズメ");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 42, "test", 17, 144, 1, "小岩井ことり", "遊びと睡眠が何より大事なぐうたら娘", "獣人族", "B", 1, "牧場（エリザベスパーク）", "あんパン", 102601, 11, "リン");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 43, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 16, 154, 7, "橋本ちなみ", "運命の相手に一途すぎる乙女", "魔族", "B", 30, "トワイライトキャラバン", "実験、裁縫、料理", 102701, 13, "エリコ");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 43, "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", 17, 156, 10, "堀江由衣", "救護院を経営する優しい庶民派お嬢様", "エルフ", "A", 4, "サレンディア救護院", "経営、お茶会", 102801, 9, "サレン");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 40, "いつか世界中の人達をファンにしてみせる！\nトップアイドルになるその日まで、\n応援よろしくね♪", 17, 157, 1, "日笠陽子", "歌って踊れる大人気アイドル", "ヒューマン", "B", 24, "カルミナ", "舞台鑑賞、ダンス", 102901, 4, "ノゾミ");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 51, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", 16, 163, 8, "佐藤聡美", "トーゴクの神秘、オシエテクダサイ！", "ヒューマン", "O", 31, "ヴァイスフリューゲル　ランドソル支部", "忍法開発", 103001, 15, "ニノン");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 42, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 18, 157, 12, "大坪由佳", "占いが得意な霊能少女", "魔族", "AB", 22, "悪魔偽王国軍（ディアボロス）", "占い", 103101, 7, "シノブ");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 45, "この私とともにいる限り、\nお金に不自由はさせませんわ！", 18, 157, 3, "松嵜麗", "一人前の商人を目指すパワフルお嬢様", "ヒューマン", "AB", 12, "メルクリウス財団", "慈善事業", 103201, 12, "アキノ");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 35, "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", 20, 142, 3, "新田恵海", "みんなを笑顔にするお笑い牧場主", "ヒューマン", "B", 3, "牧場（エリザベスパーク）", "漫才", 103301, 11, "マヒル");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 55, "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", 22, 164, 3, "今井麻美", "純情でほっとけない大人の女性", "エルフ", "A", 16, "メルクリウス財団", "ウインドーショッピング", 103401, 12, "ユカリ");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 21, "test", 8, 118, 2, "小倉唯", "礼儀正しくしっかり者のちびっ子優等生", "エルフ", "A", 2, "リトルリリカル", "お勉強", 103601, 5, "キョウカ");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 43, "test", 13, 149, 8, "茅原実里", "義理堅くてからかい好きな剣術少女", "ヒューマン", "A", 11, "王宮騎士団（NIGHTMARE）", "剣術、年長者をからかう", 103701, 8, "トモ");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 40, "ゴホッ、ゴホッ…か、身体は弱いけど、\nせめて気持ちだけでも前向きに…！\nあっ、でもダメ…立ちくらみが…", 14, 153, 11, "小清水亜美", "読書が趣味の病弱少女", "獣人族", "A", 3, "牧場（エリザベスパーク）", "読書、お散歩", 103801, 11, "シオリ");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 44, "友達ができるその日まで…\nBB団で\nトレーニングですっ！", 13, 158, 6, "花澤香菜", "「友達」に憧れる、エルフの森の女の子", "エルフ", "AB", 6, "フォレスティエ", "友達作りのイメトレ", 104001, 6, "アオイ");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 46, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 17, 163, 6, "福原綾香", "人々を守るために歌う、唱喚士の少女", "ヒューマン", "O", 3, "カルミナ", "各種楽器", 104201, 4, "チカ");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 54, "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", 17, 168, 8, "小松未可子", "男勝りで情に厚いワイルド娘", "獣人族", "O", 9, "自警団（カォン）", "お菓子作り", 104301, 10, "マコト");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 50, "test", "??", 172, 5, "丹下桜", "かつては夜を支配した最強の吸血鬼", "魔族", "A", 5, "悪魔偽王国軍（ディアボロス）", "世界征服", 104401, 7, "イリヤ");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 49, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", 18, 157, 11, "長妻樹里", "妄想大好き！　ほんとは照れ屋な女の子", "ヒューマン", "AB", 19, "ヴァイスフリューゲル　ランドソル支部", "小説を読むこと", 104501, 15, "クウカ");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 48, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 18, 158, 3, "沼倉愛美", "弱きを助け強きをくじく猫娘", "獣人族", "AB", 1, "メルクリウス財団", "猫とたわむれること", 104601, 12, "タマキ");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 50, "？？？", 25, 171, 10, "川澄綾子", "素顔を見せない冷静沈着な女性騎士", "ヒューマン", "A", 25, "王宮騎士団（NIGHTMARE）", "格闘技、湯浴み", 104701, 8, "ジュン");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 49, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", 20, 163, 11, "田所あずさ", "仕事も私事も効率優先な傭兵少女", "ヒューマン", "O", 11, "メルクリウス財団", "傭兵などのアルバイト", 104801, 12, "ミフユ");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 54, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", 18, 168, 10, "生天目仁美", "お姉ちゃんがお世話してあげるからねっ！", "ヒューマン", "O", 24, "ラビリンス", "家事全般", 104901, 3, "シズル");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 22, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", 11, 120, 1, "久野美咲", "ちょっとおませな恋に恋する女の子", "魔族", "A", 3, "ルーセント学院", "ファッション誌鑑賞、コスメ集め", 105001, 14, "ミサキ");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 53, "私は科学者だけど、\n医者の真似事もしてるの\n病気になったら診てあげるわ", 27, 166, 3, "三石琴乃", "実験が趣味の危険な科学者", "ヒューマン", "A", 7, "トワイライトキャラバン", "研究、実験", 105101, 13, "ミツキ");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 100, "私、ごく普通の、どこにでもいる女の子よ！\nみ、見た目以外はね…", 18, 150, 3, "徳井青空", "乙女チックなもふもふアニマル", "獣人族", "A", 14, "牧場（エリザベスパーク）", "毛繕い、お喋り", 105201, 11, "リマ");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 33, "「白き翼」こと、ヴァイスフリューゲル…\nその名に恥じぬよう、天高く舞い、\n華麗に敵を倒してみせる！", 18, 140, 7, "辻あゆみ", "見た目も中身もお子ちゃまな異国の軍人", "ヒューマン", "A", 28, "ヴァイスフリューゲル　ランドソル支部", "お菓子屋通い", 105301, 15, "モニカ");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 45, "test", 14, 153, 9, "木戸衣吹", "ファッション大好きなキュートガール", "ヒューマン", "AB", 7, "カルミナ", "裁縫", 105401, 4, "ツムギ");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 43, "test", 16, 155, 4, "大関英里", "どこまでも一途に慕う、純情乙女", "エルフ", "O", 7, "ヴァイスフリューゲル　ランドソル支部", "観察", 105501, 15, "アユミ");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 54, "test", 25, 167, 7, "佐藤利奈", "人情味溢れる粋でいなせな「姉御」", "ヒューマン", "B", 11, "トワイライトキャラバン", "釣り", 105601, 13, "ルカ");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 45, "私ね、一人前の騎空士になりたいんだ\nいつか父さんみたいな騎空士になって、\n空の果てまで旅する。それが私の夢だよ！", 17, 156, 3, "金元寿子", "空への冒険を夢見る騎空士の少女", "ヒューマン", "O", 10, "？？？", "冒険、おしゃべり", 105701, "", "ジータ");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 46, "あ、あの…何か食べ物持っていませんか？\nもう、お腹ペコペコで…", 17, 156, 3, "M・A・O", "いつも元気な腹ペコ少女", "ヒューマン", "O", 31, "美食殿", "食べ歩き、料理", 105801, 1, "ペコリーヌ");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 35, "主さまのガイド役を仰せつかりました\nわたくし、主さまに満足していただけるよう\n誠心誠意尽くさせていただきます", 11, 140, 5, "伊藤美来", "主を慕う、小さなガイド役", "エルフ", "B", 11, "美食殿", "瞑想、動植物の飼育", 105901, 1, "コッコロ");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 39, "なに、モタモタしてんのよ\n仕方ないから、あたしが手伝ってあげるわ\nいい？　感謝しなさいよね！", 14, 152, 9, "立花理香", "行き倒れの謎のネコミミ魔法使い", "獣人族", "A", 2, "美食殿", "猫と遊ぶ", 106001, 1, "キャル");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 40, "いいんだ、アタシは……独りでも。大丈夫だから、もう慣れたからさぁ", 16, 148, 8, "潘めぐみ", "さまよえる謎の少女", "ヒューマン", "O", 11, "？？？", "冒険、思い出話", 106101, "", "ムイミ");
