INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, "??", "", 27, 165, 2, "たかはし智秋", "傍若無人な王宮騎士団副団長", "ヒューマン", "O", 7, "王宮騎士団（NIGHTMARE）", "強敵との闘争", 107101, 8, "クリスティーナ");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 46, "あ、あの…何か食べ物持っていませんか？\nもう、お腹ペコペコで…", 17, 156, 3, "M・A・O", "いつも元気な腹ペコ少女", "ヒューマン", "O", 31, "美食殿", "食べ歩き、料理", 107501, 1, "ペコリーヌ（サマー）");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 35, "主さまのガイド役を仰せつかりました\nわたくし、主さまに満足していただけるよう\n誠心誠意尽くさせていただきます", 11, 140, 5, "伊藤美来", "主を慕う、小さなガイド役", "エルフ", "B", 11, "美食殿", "瞑想、動植物の飼育", 107601, 1, "コッコロ（サマー）");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 43, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", 15, 154, 12, "悠木碧", "お嬢さまのためにがんばるドジっ娘メイド", "ヒューマン", "O", 12, "サレンディア救護院", "ご奉仕", 107701, 9, "スズメ（サマー）");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 39, "なに、モタモタしてんのよ\n仕方ないから、あたしが手伝ってあげるわ\nいい？　感謝しなさいよね！", 14, 152, 9, "立花理香", "行き倒れの謎のネコミミ魔法使い", "獣人族", "A", 2, "美食殿", "猫と遊ぶ", 107801, 1, "キャル（サマー）");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 48, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 18, 158, 3, "沼倉愛美", "弱きを助け強きをくじく猫娘", "獣人族", "AB", 1, "メルクリウス財団", "猫とたわむれること", 107901, 12, "タマキ（サマー）");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 49, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", 20, 163, 11, "田所あずさ", "仕事も私事も効率優先な傭兵少女", "ヒューマン", "O", 11, "メルクリウス財団", "傭兵などのアルバイト", 108001, 12, "ミフユ（サマー）");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 42, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 18, 157, 12, "大坪由佳", "占いが得意な霊能少女", "魔族", "AB", 22, "悪魔偽王国軍（ディアボロス）", "占い", 108101, 7, "シノブ（ハロウィン）");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 32, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 14, 130, 1, "雨宮天", "プリン大好きゴースト娘", "魔族", "B", 23, "悪魔偽王国軍（ディアボロス）", "プリンを食べること", 108201, 7, "ミヤコ（ハロウィン）");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 22, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", 11, 120, 1, "久野美咲", "ちょっとおませな恋に恋する女の子", "魔族", "A", 3, "ルーセント学院", "ファッション誌鑑賞、コスメ集め", 108301, 14, "ミサキ（ハロウィン）");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 46, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 17, 163, 6, "福原綾香", "人々を守るために歌う、唱喚士の少女", "ヒューマン", "O", 3, "カルミナ", "各種楽器", 108401, 4, "チカ（クリスマス）");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 40, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 12, 150, 6, "植田佳奈", "泣き虫で臆病な守ってあげたい女の子", "ヒューマン", "B", 9, "サレンディア救護院", "観劇、おままごと", 108501, 9, "クルミ（クリスマス）");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 38, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 14, 148, 5, "芹澤優", "ぷうきちといつも一緒！", "ヒューマン", "B", 10, "サレンディア救護院", "屋内でできる遊び", 108601, 9, "アヤネ（クリスマス）");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 44, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 16, 155, 8, "東山奈央", "人助けが大好き！　前向き格闘娘", "獣人族", "A", 27, "トゥインクルウィッシュ", "人助け、応援", 108701, 2, "ヒヨリ（ニューイヤー）");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 47, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 17, 158, 4, "種田梨沙", "戦闘のサポートが得意な、心優しい少女", "ヒューマン", "O", 5, "トゥインクルウィッシュ", "料理、人間観察", 108801, 2, "ユイ（ニューイヤー）");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 46, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 18, 163, 1, "早見沙織", "クールで何事にも真っ直ぐな剣士", "魔族", "B", 12, "トゥインクルウィッシュ", "読書、乗馬、お茶", 108901, 2, "レイ（ニューイヤー）");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 43, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 16, 154, 7, "橋本ちなみ", "運命の相手に一途すぎる乙女", "魔族", "B", 30, "トワイライトキャラバン", "実験、裁縫、料理", 109001, 13, "エリコ（バレンタイン）");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 54, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", 18, 168, 10, "生天目仁美", "お姉ちゃんがお世話してあげるからねっ！", "ヒューマン", "O", 24, "ラビリンス", "家事全般", 109101, 3, "シズル（バレンタイン）");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 55, "私はアン！一応、マナリア王国の\n第一王女だけど…あまりかしこまらないで、\n気軽に仲良くしてくれたら嬉しいな！", 17, 156, 12, "日笠陽子", "英霊と契約を結んだマナリアの天才王女", "ヒューマン", "AB", 1, "？？？", "読書", 109201, "", "アン");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 45, "ルゥはルゥですぅ！マナリア魔法学院に\n通ってるですぅ。あなたもルゥの\nお友だちになってくれるですか？", 15, 144, 2, "こやまきみこ", "マナリア魔法学院の新入生", "ヒューマン", "O", 4, "？？？", "食べること、眠ること", 109301, "", "ルゥ");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 67, "私はグレア。竜と人、両方の血を\n受け継いでいるの…\nえっと…よ、よろしくね", 17, 167, 11, "福原綾香", "人を超越した力を有す心優しい竜姫", "半人半竜", "B", 3, "？？？", "ピアノ", 109401, "", "グレア");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 49, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", 18, 157, 11, "長妻樹里", "妄想大好き！　ほんとは照れ屋な女の子", "ヒューマン", "AB", 19, "ヴァイスフリューゲル　ランドソル支部", "小説を読むこと", 109501, 15, "クウカ（オーエド）");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 51, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", 16, 163, 8, "佐藤聡美", "トーゴクの神秘、オシエテクダサイ！", "ヒューマン", "O", 31, "ヴァイスフリューゲル　ランドソル支部", "忍法開発", 109601, 15, "ニノン（オーエド）");
