INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 40, "いいんだ、アタシは……独りでも。大丈夫だから、もう慣れたからさぁ", 16, 148, 8, "潘めぐみ", "さまよえる謎の少女", "ヒューマン", "O", 11, "？？？", "冒険、思い出話", 114701, "", "ムイミ（ニューイヤー）");
