INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 42, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", 16, 155, 9, "内田真礼", "マホマホ王国のプリンセス", "獣人族", "O", 22, "自警団（カォン）", "空想、ぬいぐるみ集め", 116001, 10, "マホ（シンデレラ）");
