INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 46, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 17, 163, 6, "福原綾香", "人々を守るために歌う、唱喚士の少女", "ヒューマン", "O", 3, "カルミナ", "各種楽器", 117301, 4, "チカ（サマー）");
