INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (0, 46, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 18, 163, 1, "早見沙織", "クールで何事にも真っ直ぐな剣士", "魔族", "B", 12, "トゥインクルウィッシュ", "読書、乗馬、お茶", 122501, 2, "レイ（サマー）");
